INSERT INTO `Content` (`id`, `title`, `shortDescription`, `fullDescription`, `image`, `id_category`) VALUES
(1, 'Отель Элион', 'Норм отель', 'Апартаменты «На Октябрьской» находятся в центре Омска. В них есть балкон. На всей территории работает бесплатный Wi-Fi.\r\n\r\nВ отеле к услугам гостей балкон, диван и рабочая зона. Собственная кухня оборудована духовкой, микроволновой печью и холодильником. Полотенца, бесплатные туалетно-косметические принадлежности и постельное белье входят в стоимость проживания.\r\n\r\nРасстояние до аэропорта Омск-Центральный составляет 5 км. ', , 4);
INSERT INTO `Content` (`id`, `title`, `shortDescription`, `fullDescription`, `image`, `id_category`) VALUES
(2, 'Отель Гранд Будапешт', 'Отличный отель для отдыха', 'Отель Apartment on Karla Marksa 8 расположен в Омске, всего в 8 минутах ходьбы от Омского областного музея изобразительных искусств им. М. А. Врубеля. К услугам гостей номера с бесплатным Wi-Fi. Отель находится в 1,6 км от Омского драматического театра и в 2,4 км от Омской государственной областной научной библиотеки им. А. Пушкина.', , 5);
INSERT INTO `Content` (`id`, `title`, `shortDescription`, `fullDescription`, `image`, `id_category`) VALUES
(3, 'Маяк', 'Двухместный номер с 2 отдельными кроватями  Число гостей: 2 — Просторнее большинства других номеров — Омск', 'До пляжа можно дойти всего за 4 минуты. Отель \"Маяк\" расположен в Омске на стыке двух рек - Омь и Иртыш. Гостям предлагаются просторные номера с ЖК-телевизором и бесплатным беспроводным доступом в Интернет.\r\n\r\nВ ресторане отеля \"Маяк\" подаются блюда европейской и русской кухни. Каждое утро сервируется завтрак \"шведский стол\".\r\n\r\nГости смогут расслабиться в тренажерном зале. ', , 3);
INSERT INTO `Content` (`id`, `title`, `shortDescription`, `fullDescription`, `image`, `id_category`) VALUES
(4, 'Отель Грезы', 'Лучший отель в Кировске', 'Интерьер гостиницы выполнен в классическом стиле, ничего лишнего, спокойная естественная элегантность, надежность и удобство. Оригинально оформленные номера. Wi-Fi в каждом номере.', , 1);
INSERT INTO `Content` (`id`, `title`, `shortDescription`, `fullDescription`, `image`, `id_category`) VALUES
(5, 'Отель Амакс Омск', 'Один из лучших отелей в Амуре', 'АМАКС Отель Омск является одной из самых крупных гостиниц Омска и Омской области. Она может принять более двухсот человек одновременно, поскольку имеет 194 номера с полной телефонизацией, бесплатным Wi Fi, а также комплексом дополнительных услуг. Для гостей предлагаются различные по наполняемости и размерам категории номеров.', , 2);
INSERT INTO `Content` (`id`, `title`, `shortDescription`, `fullDescription`, `image`, `id_category`) VALUES
(6, 'Отель Малибу', 'Лучший отель в Центре', 'В отеле \"Малибу\", расположенном в самом центре Омска, к услугам гостей красочные номера с бесплатным Wi-Fi. По вечерам гостей развлекают караоке. Соборная площадь находится в 500 метрах. Предоставляется бесплатная парковка.', , 3);
INSERT INTO `Content` (`id`, `title`, `shortDescription`, `fullDescription`, `image`, `id_category`) VALUES
(7, 'Отель Ibis', 'Лучший отель в Сибири', 'В отеле Ibis, расположенном на набережной Омска, к услугам гостей красочные номера с бесплатным Wi-Fi. По вечерам гостей развлекают караоке. Соборная площадь находится в 500 метрах. Предоставляется бесплатная парковка.', , 5);
INSERT INTO `Content` (`id`, `title`, `shortDescription`, `fullDescription`, `image`, `id_category`) VALUES
(8, 'Отель Общага', 'Общага ОмГТУ №6', 'Расположен в городке Нефтяников города Омска, Имеется душ, матрас, подушка, одеяло, кровать и ремонт 1966 года', , 1);
INSERT INTO `Content` (`id`, `title`, `shortDescription`, `fullDescription`, `image`, `id_category`) VALUES
(9, 'Отель Plazza', 'Один из самых комфортных мест отдыха Омска', 'Если Вам предстоит посетить Омск, и Вы ищите недорогую, но комфортабельную гостиницу с высоким уровнем обслуживания и приятной, уютной обстановкой, то Вам непременно стоит забронировать номер в нашей гостинице.\r\nНаш комплекс идеально подходит как для деловой поездки, путешествия, так и для размеренного семейного отдыха.', , 1);

